USE [ProtectedServer]
GO
create table GlobalParameter (
	[ParameterID] [varchar](50) PRIMARY KEY NOT NULL,
	[Value] [varchar](255) NOT NULL,
	[Description] [varchar](255) NULL
);
declare @NowDate datetime = getdate()
GO
create table News (
	Id BIGINT IDENTITY(1, 1) PRIMARY KEY NOT NULL,
	NewsId VARCHAR(100) NOT NULL,
	Title VARCHAR(1000) NOT NULL,
	Content VARCHAR(MAX) NOT NULL,
	[IsActive] [bit] NOT NULL,
	[CreatedBy] [varchar](15) NOT NULL,
	[CreatedDate] [datetime] NOT NULL,
	[ModifiedBy] [varchar](15) NULL,
	[ModifiedDate] [datetime] NULL,
    CONSTRAINT UC_News UNIQUE (NewsId)
);
GO
create table University (
	Id BIGINT IDENTITY(1, 1) PRIMARY KEY NOT NULL,
	Name VARCHAR(500),
	Address VARCHAR(1000),
    CONSTRAINT UC_University UNIQUE (Name)
);
GO
create table Company (
	Id BIGINT IDENTITY(1, 1) PRIMARY KEY NOT NULL,
	Name VARCHAR(500),
	Industry VARCHAR(1000),
	Market VARCHAR(100),
    CONSTRAINT UC_Company UNIQUE (Name)
);
GO
SELECT * FROM University
SELECT * FROM Company